    data: JsonApiResourceData,
    included: JsonApiIncludedData,
    fields: AnyResourceFilterOptions,
    pointer: ApiErrorPointer = [],
  ) {
    const errors: Array<ApiError> = []
    const resourceFields = fields[Resource.type] || Object.keys(Resource.fields)
    const item = resourceFields.reduce(
      (item: any, fieldName: ResourceFieldName) => {
        const field = Resource.fields[fieldName]
        const value = this.getResourceDataValue(data, field)
        if (
          field.validate(value) ||
          (field.isOptionalAttributeField() && isNull(value))
        ) {
          if (field.isAttributeField()) {
            item[field.name] = value
          } else if (field.isToOneRelationshipField()) {
            item[field.name] = isNull(value)
              ? value
              : this.decodeApiResponseRelationshipData(
                  field,
                  value as JsonApiResourceData,
                  included,
                  fields,
                  pointer.concat(fieldName),
                )
          } else if (field.isToManyRelationshipField()) {
            item[field.name] = (value as Array<JsonApiResourceData>).map(
              (value) =>
                this.decodeApiResponseRelationshipData(
                  field,
                  value,
                  included,
                  fields,
                  pointer.concat(fieldName),
                ),
            )
          }
        } else {
          const errorMessage = this.api.getValidationErrorMessage(field, value)
          errors.push(
            new ApiValidationError(errorMessage, pointer.concat(fieldName)),
          )
        }

        return item
      },
      createDataObject({
        type: data.type,
        id: data.id,
      }),
    )
    if (errors.length) {
      throw errors
    }
    return new Resource(item)
  }

  decodeApiResponseRelationshipData(
    field: AnyResourceRelationshipField,
    data: JsonApiResourceData,
    included: JsonApiIncludedData,
    fields: AnyResourceFilterOptions,
    pointer: ApiErrorPointer,
  ) {
    const Resource = this.getApiResource(field.type)
    if (Resource == null) {
      if (__DEV__) {
        console.error(
          `Resource of type ${field.type} is ${Resource}, this is likely a Resource type name misspelling, or there is no endpoint registered for this resource.`,
        )
      }
      return field.isToManyRelationshipField() ? [] : null
    }
    if (field.type in fields) {
      const relationshipData = included.find(
        (item) => item.id === data.id && item.type === data.type,
      )! // todo: catch not included
      return this.decodeApiResourceData(
        Resource,
        relationshipData,
        included,
        fields,
        pointer.concat(field.name),
      )
    }
    return new ResourceIdentifier(data.type, data.id)
  }

  getResourceDataValue(
    data: JsonApiResourceData,
    field: any,
  ): ResourceFieldValue {
    if (field.isAttributeField()) {
      if (isWithAttributes(data)) {
        if (field.name in data.attributes) {
          return data.attributes[field.name]
        } else if (__DEV__) {
          console.warn(
            `Invalid response: attribute field ${field.name} is missing`,
          )
        }
      } else if (__DEV__) {
        console.warn(`Invalid response: data has no attributes`)
      }
    } else if (field.isRelationshipField()) {
      if (isWithRelationships(data)) {
        const relationshipValue = data.relationships[field.name]
        if (isWithData(relationshipValue)) {
          return relationshipValue.data
        } else if (__DEV__) {
          console.warn(
            `Invalid response: relationship field ${field.name} must be an object with a data property`,
          )
        }
      } else if (__DEV__) {
        console.warn(`Invalid response: data has no relationships`)
      }
    }
    return field.isToManyRelationshipField() ? [] : null
  }

  async fetchGetRequest<T>(url: string): Promise<JsonApiSuccessResponse<T>> {
    return this.handleFetchRequest(url, {
      method: HTTPMethod.GET,
      headers: createDataObject(defaultGetRequestHeaders),
    })
  }

  async getResourceById(
    Resource: AnyResourceConstructor,
    path: ApiEndpointPath,
    id: ResourceId,
    filter: AnyResourceFilter,
  ) {
    const url = this.getURL([path, id], defaultApiQuery as any, filter)
    const { data, included = [], meta = {} } = await this.fetchGetRequest<
      JsonApiResourceData
    >(url)
    const result = this.decodeApiResourceData(
      Resource,
      data,
      included,
      filter.fields,
    )
    return new ApiResult(result, meta)
  }

  async getResourceCollection(
    Resource: AnyResourceConstructor,
    path: ApiEndpointPath,
    query: ApiResourceQuery<any>,
    filter: AnyResourceFilter,
  ) {
    const url = this.getURL([path], query, filter)
    const { data, included = [], meta = {} } = await this.fetchGetRequest<
      Array<JsonApiResourceData>
    >(url)
    const resultData = data.map((value) =>
      this.decodeApiResourceData(Resource, value, included, filter.fields),
    )
    return new ApiResult(resultData, meta)
  }

  getURL(
    path: Array<string>,
    query: ApiResourceQuery<any>,
    filter: AnyResourceFilter,
  ): string {
    if ('page' in query) {
      query = Object.assign({}, query, {
        page: (this.api.createPageQuery as any)(query.page),
      })
    }
    const params = String(filter.query.concat(query))
    return `${joinURLPaths(this.api.url, ...path)}${params}`
  }

  getResponseErrorPointer(error: JsonApiErrorData): Array<string> {
    if (isSome(error.source) && isString(error.source.pointer)) {
      const { pointer } = error.source
      if (/^\/data\/[attributes|relationships]/.test(pointer)) {
        return parseJsonApiPointer(pointer).slice(2)
      }
    }
    return []
  }

  getResponseErrorStatus(error: JsonApiErrorData): ApiRequestStatus {
    if (isString(error.status)) {
      const status = Number(error.status)
      if (isNumber(status)) {
        return status
      }
    }
    return null
  }

  async handleFetchRequest(url: string, requestData: RequestData) {
    const response = await fetch(url, this.api.beforeRequest(requestData))
    const responseData = await response.json()
    const errors: Array<ApiError> = (responseData.errors || []).map(
      (error: JsonApiErrorData) => {
        return new ApiRequestError(
          String(this.api.getRequestErrorMessage(error)),
          this.getResponseErrorPointer(error),
          this.getResponseErrorStatus(error),
        )
      },
    )
    if (errors.length !== 0) {
      throw errors
    }
    return responseData
  }

  async fetchPostRequest<T>(
    url: ApiURL,
    data: SerializableObject,
  ): Promise<JsonApiSuccessResponse<T>> {
    return this.handleFetchRequest(url, {
      method: HTTPMethod.POST,
      headers: createDataObject(defaultPostRequestHeaders),
      body: JSON.stringify({ data }),
    })
  }

  async fetchPatchRequest<T>(
    url: ApiURL,
    data: SerializableObject,
  ): Promise<JsonApiSuccessResponse<T>> {
    return this.handleFetchRequest(url, {
      method: HTTPMethod.PATCH as any, // todo: wtf?
      headers: createDataObject(defaultPostRequestHeaders),
      body: JSON.stringify({ data }),
    })
  }

  async createResource(
    Resource: AnyResourceConstructor,
    path: ApiEndpointPath,
    item: any,
  ): Promise<any> {
    const errors: Array<ApiError> = []
    if (item.type === undefined) {
      item.type = Resource.type
    } else if (item.type !== Resource.type) {
      const errorMessage = this.api.getValidationErrorMessage(
        'type' as any,
        item.type,
      )
      errors.push(new ApiValidationError(errorMessage, ['type']))
    }
    const data = Object.values(Resource.fields).reduce((data, field) => {
      const value = item[field.name]
      if (!field.validate(value)) {
        const errorMessage = this.api.getValidationErrorMessage(field, value)
        errors.push(new ApiValidationError(errorMessage, [field.name]))
      }
      if (field.isAttributeField()) {
        data.attributes[field.name] = value
      } else if (field.isRelationshipField()) {
        data.relationships[field.name] = {
          data: value,
        }
      }
      return data
    }, createJsonApiBaseData(item.type, item.id))
    if (errors.length) {
      throw errors
    }
    return this.fetchPostRequest(joinURLPaths(this.api.url, path), data).then(
      (response) => {
        const result = this.decodeApiResourceData(
          Resource,
          response.data as any,
          [],
          {},
        )
        return new ApiResult(result, response.meta || {})
      },
    )
  }

  async patchResource(
    Resource: AnyResourceConstructor,
    path: ApiEndpointPath,
    item: any,
  ): Promise<any> {
    const errors: Array<ApiError> = []
    if (item.type === undefined) {
      item.type = Resource.type
    }
    const data = Object.values(Resource.fields).reduce((data, field) => {
      const value = item[field.name]
      if (!isUndefined(value)) {
        if (!field.validate(value)) {
          const errorMessage = this.api.getValidationErrorMessage(field, value)
          errors.push(new ApiValidationError(errorMessage, [field.name]))
        }
        if (field.isAttributeField()) {
          data.attributes[field.name] = value
        } else if (field.isRelationshipField()) {
          data.relationships[field.name] = {
            data: value,
          }
        }
      }
      return data
    }, createJsonApiBaseData(item.type, item.id))
    if (errors.length) {
      throw errors
    }
    return this.fetchPatchRequest(
      joinURLPaths(this.api.url, path, item.id),
      data,
    ).then((response) => {
      const result = this.decodeApiResourceData(
        Resource,
        response.data as any,
        [],
        {},
      )
      return new ApiResult(result, response.meta || {})
    })
  }

  addApiResource(Resource: AnyResourceConstructor): this {
    this.resources[Resource.type] = Resource
    return this
  }

  getApiResource(type: ResourceType): AnyResourceConstructor | undefined {
    return this.resources[type]
  }

  static add(api: Api): void {
    if (__DEV__ && api.url in controllers) {
      throw `Api at "${api}" already exists`
    }
    controllers[api.url] = new ApiController(api)
  }

  static get(api: Api): ApiController {
    return controllers[api.url]
  }
}

export const createResourceFilterQuery = (
  Resource: AnyResourceConstructor,
  fields: AnyResourceFilterOptions,
): AnyApiQuery => {
  // todo: throw error if a type that is not included is queried
  if (isNone(fields)) {
    return defaultApiQuery
  }
  const fieldsEntries = Object.entries(fields)
  if (fieldsEntries.length === 0) {
    return defaultApiQuery
  }
  const query = fieldsEntries.reduce((resourceQuery, [type, values]) => {
    if (__DEV__ && !isNonEmptyArray(values)) {
      console.warn(
        'Invalid value for ResourceFilter, Array of field names must not be empty',
      )
    }
    resourceQuery.fields[type] = values
    if (type !== Resource.type) {
      for (const fieldName in Resource.fields) {
        if (Object.hasOwnProperty.call(Resource.fields, fieldName)) {
          const field = Resource.fields[fieldName]
          if (field.isRelationshipField() && field.type === type) {
            if (!resourceQuery.include.includes(fieldName)) {
              resourceQuery.include.push(fieldName)
            }
          }
        }
      }
    }
    return resourceQuery
  }, createBaseResourceQuery())
  return new ApiQuery(query as any)
}
